var $bm_rt;
var color;
var d = $bm_div(effect('Slider Control')('Slider'), 100);
var rgb = thisComp.layer('bulb').effect('Color Control')('Color').valueAtTime($bm_sub(time, d));
$bm_rt = color = [
    $bm_mul(rgb[0], value[0]),
    $bm_mul(rgb[1], value[1]),
    $bm_mul(rgb[2], value[2]),
    $bm_mul(rgb[3], value[3])
];

var $bm_rt;
var d = $bm_div(effect('Slider Control')('Slider'), 100);
$bm_rt = thisComp.layer('bulb').effect('Color Control')('Color').valueAtTime($bm_sub(time, d));

s.x:
