var x, s, y;
x = effect('Coin Flip')('Flip');
s = $bm_div(effect('Coin Flip')('Max Flip'), 2);
y = linear(x, 0, 100, s, 100);
$bm_rt = [
    value[0],
    y
];

var $bm_rt;
var x, y, yAdd, Y;
x = effect('Coin Flip')('Flip');
y = linear(x, 0, 100, 20, 0);
yAdd = effect('Coin Flip')('Extrude');
Y = linear(x, 0, 100, yAdd, 0);
$bm_rt = [
    value[0],
    y + Y
];

